# OEIS sequence: A381623

def row(n):
    i, J, out = 0, list(range(1, n+1)), []
    while len(J) > 1:
        i = i%len(J)
        out.append(J.pop(i))
        i = (i + 2)%len(J)
    return out + [J[0]]
print([e for n in range(1, 14) for e in row(n)]) # _Michael S. Branicky_, Mar 27 2025

